export default function AdminPatients() {
  return (
    <div className="p-6 max-w-5xl mx-auto">
      <h1 className="text-2xl font-semibold mb-4">Admin - Patients</h1>
      <p className="text-gray-600">Placeholder patients management.</p>
    </div>
  )
}
